angular.module("bookShelf").factory("BookService",["$http","$q",function(e,t){var n={};return{getBookList:function(){return e.get("http://fakerestapi.azurewebsites.net/api/Books").then(function(t){return t.data})},setBook:function(t){n=t},getBook:function(){return n},syncBook:function(t){return e({url:"http://fakerestapi.azurewebsites.net/api/Books/"+(t.ID||""),method:t.ID?"PUT":"POST",data:t}).then(function(t){return t.data})},removeBook:function(t){return e.delete("http://fakerestapi.azurewebsites.net/api/Books/"+t.ID).then(function(t){return t.data})},paginate:function(t,e,n){return t.slice((e-1)*n,e*n)}}}]);